module.exports = /*#__PURE__*/JSON.parse('[{"id":"incredible-vegan-mac-and-cheese","content":"\\r\\n\\r\\n##### Season the Chicken\\r\\n\\r\\nThree primary ingredients: taco seasoning, garlic, and a shot of soy sauce! Im showing the taco seasoning on the chicken first in this picture, but Ive come to realize that mixing works best if you start with the wet stuff (oil and soy sauce) and then finish with a quick toss in the dry spices! Doesnt get quite so clumpy.\\r\\n\\r\\n##### Cook the Chicken\\r\\n\\r\\nI like to air fry it  425 degrees for 11 minutes.\\r\\n\\r\\n##### Make a Green Sauce\\r\\n\\r\\nNot essential, but this is the kind of sauce that makes life worth living.\\r\\n\\r\\n##### Cut Up The Chicken\\r\\n\\r\\nJust give it a good rough chop into little bite-sized pieces, like how it is at Chipotle. While you have the cutting board out, go ahead and chop some cilantro and onions, too!Youre Done! Yum!\\r\\n","title":"Good Chicken Tacos with Green Sauce","date":"2022-04-02","image":"/img/blog/1.jpg","categories":["Recipes"],"tags":["Recipes","Menu","Food"],"author":"Charlie Williams","short":"Just 20 minutes to get these chicken tacos on the table! Juicy, flavorful, and absolutely mindless in the best way.","introLayout":2,"postLayout":2,"details":{"title":"Ingredients:","items":[{"label":"Numquam","value":"1 pack"},{"label":"Cupiditate","value":"150g"},{"label":"Adipisicing","value":"1kg"},{"label":"Dolorem obcaecati","value":"3 Teaspoon"},{"label":"Porro","value":"2 pack"},{"label":"Vel fuga","value":"300g"}]}},{"id":"creamy-kale-pasta","content":"\\r\\nIs it because its an excuse to load up half the plate with that gorgeous peach salad? Maybe. I love peaches.\\r\\n\\r\\nBut also, the shrimp are delicious! I made this one more time this afternoon to make sure I had the spices all correct before we published this recipe, and I ended up just standing over the pan eating just one more. And then just one more. And then just one more. They can easily stand on their own.\\r\\n\\r\\nBesides being super easy (YAY ITS MY FAVORITE THING), the thing I like about this is that it creates that mix of heat, smoke, and sweetness with some new flavors.\\r\\n\\r\\n###### VMake Your Peach Salad\\r\\n\\r\\nThis can and probably should be made first because the shrimp cook really fast. Chop, toss, and let it hang for the next 20 minutes while you do the shrimp!\\r\\n\\r\\n###### Toss Shrimp with Spices\\r\\n\\r\\nTheres smoked paprika, curry powder, salt, garlic powder, and some cayenne for heat.\\r\\n\\r\\n###### Cook the shrimp\\r\\nI cook them in olive oil, and then when theyre almost done I like to add a bit of butter and honey to the pan  it pulls up the browned bits and creates kind of a glazey sauce on the shrimp.\\r\\n\\r\\n###### Youre Done! Yum!\\r\\n\\r\\nPile that steamy shrimp on rice with a big scoop of peach salad (also pictured here: avocado)! Its so good.","title":"Spicy Shrimp with Peach Salad","date":"2022-04-02","image":"/img/blog/2.jpg","categories":["News of the restaurant"],"tags":["Restaurant","Caffe"],"author":"Nguta Ithya","short":"Spicy shrimp with all the delicious heat, smoke, and sweetness we want, alongside a fresh peach and cucumber salad.","introLayout":1,"postLayout":3,"details":{"title":"Ingredients:","items":[{"label":"Numquam","value":"1 pack"},{"label":"Cupiditate","value":"150g"},{"label":"Adipisicing","value":"1kg"},{"label":"Dolorem obcaecati","value":"3 Teaspoon"},{"label":"Porro","value":"2 pack"},{"label":"Vel fuga","value":"300g"}]}},{"id":"tips-for-planning-a-menu","content":"\\r\\nIve done this with both ground chicken and ground turkey  I prefer turkey, maybe because it has a bit more fat? Ground beef also works, as does Italian sausage  and maybe you want to mix and match because this recipe is begging to be doubled.\\r\\n\\r\\nAs far as serving goes, it is physically impossible for us to NOT have these with garlic bread. I adore this garlic bread so much. But good old buttered noodles would work, too! And for veggies, a simple green salad, bagged Caesar salad, or steam-in-the-bag green beans on the side  all great options.\\r\\n\\r\\n###### Combine the meatball mixture\\r\\n\\r\\nEverything all in one bowl! No cutting board required.\\r\\n\\r\\n###### Roll into Meatballs\\r\\nPlace them in an oiled pan to prevent sticking\\r\\n\\r\\n###### Bake the Meatballs.\\r\\n\\r\\n400 degrees for 20-25 minutes, to golden, juicy perfection.\\r\\n\\r\\n###### Add Sauce\\r\\nI just add a jar of sauce directly to the pan.\\r\\n\\r\\n###### Add the crispy topping.\\r\\n\\r\\nOptional but fun! Gives the whole thing a little texture and bling. Broil for a few minutes to get it crispy!","title":"Ricotta Meatballs with the Crispy Topping","date":"2022-03-02","image":"/img/blog/6.jpg","categories":["Menu"],"tags":["Menu","Caffe"],"author":"Charlie Williams","short":"These Ricotta Meatballs are an easy and delicious family favorite! Tender, juicy homemade meatballs with a jar of good marinara and a crispy topping to finish it all off. YUM!","introLayout":1,"postLayout":1,"details":{"title":"Ingredients:","items":[{"label":"Numquam","value":"1 pack"},{"label":"Cupiditate","value":"150g"},{"label":"Adipisicing","value":"1kg"},{"label":"Dolorem obcaecati","value":"3 Teaspoon"},{"label":"Porro","value":"2 pack"},{"label":"Vel fuga","value":"300g"}]}},{"id":"join-us-for-plant-powered-january","content":"\\r\\nTHE FLAVOR. Garlic, ginger, soy, and curry powder with the umami of beef is not going to let you down. Its just not, okay? Its warming and rich (hello curry powder!) but pleasantly sharp at the same time (looking at you, garlic), and is it weird that I enjoy smelling it almost as much as I enjoy eating it?\\r\\n\\r\\nTHE STRIPS. Theyre thin. Theyre browned and caramelized but still juicy. They eat, honestly, like little bites of savory candy. They cook for 6 minutes, 7 tops. Delicious.\\r\\n\\r\\n###### Cut the Beef into Thin Strips.\\r\\n\\r\\nCut against the grain into thin strips. If the skirt steak itself is very thin, fold it over itself a few times to make it easier to cut (as shown in this picture).\\r\\n\\r\\n###### Add Some Flavor.\\r\\nAdd garlic, ginger, soy sauce, curry powder, salt, and sugar. MAGIC, Im telling you.\\r\\n\\r\\n###### Skewer (Or Not).\\r\\nFYI, things smell amazing at this point. Scrunch that yummy beef onto soaked skewers! Doesnt have to be perfect. If that feels like too much work, skip it! You can pan fry or air fry. Instructions are down below.\\r\\n\\r\\n###### Blast Them With Heat.\\r\\nBroil the skewers for 6 minutes. Caramelized on top, juicy, full of flavor. So good. (Alternate instructions below, too.)\\r\\n\\r\\n##### Youre Done! Yum!\\r\\nPop the beef into a rice bowl with a little cucumber shallot salad. Highly recommend finishing with a drizzle of fish sauce and lime juice! Oooo-ee! Yum.","title":"Garlic and Black Pepper Beef Skewers","date":"2022-03-02","image":"/img/blog/5.jpg","categories":["Service sector"],"tags":["Services","Rest"],"author":"Tamzyn French","short":"These beef skewers are bringing all the flavor! Thinly sliced strips of steak browned and caramelized to juicy, sweet perfection.","introLayout":1,"postLayout":1,"details":{"title":"Ingredients:","items":[{"label":"Numquam","value":"1 pack"},{"label":"Cupiditate","value":"150g"},{"label":"Adipisicing","value":"1kg"},{"label":"Dolorem obcaecati","value":"3 Teaspoon"},{"label":"Porro","value":"2 pack"},{"label":"Vel fuga","value":"300g"}]}},{"id":"the-best-chicken-tinga-tacos","content":"\\r\\nFirst of all, theres papery thin vegetables (cucumber! shallot!) and a whole lot of herbs (mint! cilantro! add more, more, more!).\\r\\n\\r\\nAnd secondly, theres a beautiful pile of clumpy fried golden red curry jasmine rice  its crisped and golden on the outside, but soft and carby enough on the insides to still absorb some of the limey, garlicky, salty vinaigrette with all the flavor.\\r\\n\\r\\n\\r\\n\\r\\n##### Prep Your Dressing and Herbs.\\r\\nBlitz up the dressing, and chop up the salad stuff. I like to use a mandoline for the cucumbers and shallots.\\r\\n\\r\\n##### Mix The Rice with Curry Paste.\\r\\nMix the rice with a bit of oil and red curry paste. For the air fryer, I like to have the texture being sticky / wet enough that you can kind of squeeze it into loose chunks. If the rice is dried out / several days leftover, I will add a tablespoon or two of water and maybe even a bit of cornstarch to the mix to help it revive a bit.\\r\\n\\r\\n##### Clump Your Rice Into the Air Fryer.\\r\\nYes, clump it. Just place sticky handfuls of the rice in the air fryer in a single layer. They dont have to be balls, but you also dont want each individual grain of rice to be separated. Just kinda clump it in there.\\r\\n\\r\\n##### Air Fry the Rice!\\r\\nI do it at 420 for about 8 minutes till its nice and golden brown and crispy around the edges! (If you dont have an air fryer, there are other options in the notes.) See how it kind of makes clusters? When its done, scoop chunks of the rice onto your salad bowl! \\r\\n\\r\\n##### Toss It Up!\\r\\nToss the veggies and rice with the dressing.\\r\\n##### Youre done! YUM!\\r\\nSeriously. This might be my favorite salad Ive ever made.\\r\\n\\r\\n","title":"Crispy Rice Salad with Cucumbers and Herbs","date":"2022-02-02","image":"/img/blog/4.jpg","categories":["Recipes"],"tags":["Recipes","Food"],"author":"Charlie Williams","short":"Paper-thin veggies, a shower of herbs, a pile of fried crispy red curry rice, and a limey garlicky vinaigrette all over top.","introLayout":1,"postLayout":1,"details":{"title":"Ingredients:","items":[{"label":"Numquam","value":"1 pack"},{"label":"Cupiditate","value":"150g"},{"label":"Adipisicing","value":"1kg"},{"label":"Dolorem obcaecati","value":"3 Teaspoon"},{"label":"Porro","value":"2 pack"},{"label":"Vel fuga","value":"300g"}]}},{"id":"beet-and-burrata-salad-with-fried-bread","content":"\\r\\nIts a textural wonder: a gentle layering of juicy and slippery, flexible and foldy. Weve got fresh cucumber, bitey shallots, cooling mint, and sweet fleshy peaches coming together in serious flavor harmony. The lime juice in there wakes it up and makes it feel extra summery, and the flecks of lime zest, salt, and pepper make it feel like something youd eat at a nice restaurant. \\r\\n###### Slice That Peachy Goodness!\\r\\nSlices are ideal, in my opinion! Those thin, long pieces just layer together really nicely. You can do it by hand, but a mandoline is my must-have tool for this!\\r\\n\\r\\n\\r\\n##### Get The Cucumbers Saucy.\\r\\nI kind of like the cucumbers to have a softer, more bendy quality in this salad, so I let them sit with the shallots in lime juice, salt, and olive oil for a while to loosen em up.\\r\\n\\r\\n##### Add Peaches, Mint, and Honey!\\r\\nGive it a gentle toss. Season as you like. I love hot honey in this salad. Like, LOVE.\\r\\n\\r\\n##### Youre Done! Yum!\\r\\nSeriously so good. One of my favorites for a quick, beautiful, fresh summer meal or side. Also great with avocado slices in there!","title":"Gorgeous Peach Salad","date":"2022-02-02","image":"/img/blog/7.jpg","categories":["Gastronomy"],"tags":["Gastronomy","Fast Food"],"author":"Peter Stanbridge","short":"Fresh cucumber, bitey shallots, cooling mint, and sweet fleshy peaches coming together in serious flavor harmony! I love this peach salad.","introLayout":1,"postLayout":1,"details":{"title":"Ingredients:","items":[{"label":"Numquam","value":"1 pack"},{"label":"Cupiditate","value":"150g"},{"label":"Adipisicing","value":"1kg"},{"label":"Dolorem obcaecati","value":"3 Teaspoon"},{"label":"Porro","value":"2 pack"},{"label":"Vel fuga","value":"300g"}]}},{"id":"the-office-business-lunch","content":"\\r\\nMarry Me Chicken has been around for a while, but this month has been my first time trying it. The original version pan fries the chicken in the same pan as the sauce  and this makes sense in theory, but you guys, I just love the air fryer chicken. It tastes better. Its more consistent and reliable. Its juicy and its got great flavor, exterior texture, and color. Its hands-off. Its just about the only way that I make chicken now. Im willing to wash one extra dish (the air fryer basket) in favor of having my favorite juicy chicken with the golden crust on the outside.\\r\\n\\r\\nThe other difference here is that original Marry Me Chicken also has sun-dried tomatoes, but I dont LOVE-love sun-drieds, so I went with a jar of DeLallo marinated bruschetta-style tomatoes which are fresher and juicier (similar to juicy petite diced canned or fresh tomatoes), and boom! It was divine.\\r\\n\\r\\n\\r\\n###### Get it all ready to go.\\r\\nPrep the chicken. Thinly slice some garlic. Drain your tomatoes.\\r\\n\\r\\n###### Start the Garlic, Butter, and Tomato Paste.\\r\\nGet these three going over low heat to start to develop some flavor.\\r\\n\\r\\n###### Add Cream, Broth, and Thyme.\\r\\nWhisk and then let it all simmer up for a while so it can thicken into a nice sauce.\\r\\n\\r\\n###### Add Chicken and Tomatoes.\\r\\nPull out the sprigs of thyme and get your tomatoes in the sauce. Finally, tuck those gorgeous pieces of chicken into the whole thing.\\r\\n\\r\\n###### Youre Done! Yum!\\r\\nOOOH MY the flavor of that sauce is just next level. Are we in a restaurant right now? I think were in a restaurant.\\r\\n","title":"Marry Me Chicken","date":"2022-01-02","image":"/img/blog/3.jpg","categories":["Menu"],"tags":["Menu","Eat"],"author":"Nguta Ithya","short":"Golden, juicy chicken coated in a simple creamy sauce with tomatoes, garlic, and thyme. I love this with mashed potatoes and a salad!","introLayout":1,"postLayout":1,"details":{"title":"Ingredients:","items":[{"label":"Numquam","value":"1 pack"},{"label":"Cupiditate","value":"150g"},{"label":"Adipisicing","value":"1kg"},{"label":"Dolorem obcaecati","value":"3 Teaspoon"},{"label":"Porro","value":"2 pack"},{"label":"Vel fuga","value":"300g"}]}},{"id":"quinoa-sweet-potato-salad","content":"\\r\\nIt is silky and slightly creamy, spicy, garlicky (!!), and a little tangy and salty from the soy sauce and rice vinegar. I literally just whispered oof outloud as I am reliving it in my mind. Its so good.\\r\\n\\r\\nIt has very quickly earned a top spot in my list of Favorite Sauces of 2024, and it takes all of five minutes to make. WHEEE! Things I have used this sauce on:\\r\\n\\r\\n- a dip for air fryer chicken (this was the OG, which naturally leads to)\\r\\n- a dip for air fryer tofu!\\r\\n- and a dip for the air fryer salmon!\\r\\n- a smashburger!\\r\\n- a salad dressing!\\r\\n- a sauce on a rice bowl!\\r\\n- a drizzle for a wrap or sandwich!\\r\\n\\r\\nIts just the sauce of my life these days. Initially I just tucked it into the notes of the air fryer chicken post, because I thought  it wont need its own blog post because I mostly will only use it for this? which was very delusional. Because then I started putting it on everything. And I realized it needs its own home here on POY.\\r\\n\\r\\n##### Mix up your sauce ingredients.\\r\\nLove a one-step recipe.\\r\\n##### Youre Done! Yum!\\r\\nUse it to dip, dunk, drizzle, spread, swoop, and/or all of the above. Here is a picture of this gochujang sauce on a kale and cabbage salad (similar to this guy!) with air fryer chicken on top.","title":"Incredible Gochujang Sauce","date":"2022-01-02","image":"/img/blog/8.jpg","categories":["News of the restaurant"],"tags":["Restaurant","Eat","Caffe"],"author":"Peter Stanbridge","short":"This delightful, creamy, silky, incredible gochujang sauce is what I put on everything! Dipped with chicken, drizzled on a bowl, tossed in a salad  perfect in every way.","introLayout":1,"postLayout":1,"details":{"title":"Ingredients:","items":[{"label":"Numquam","value":"1 pack"},{"label":"Cupiditate","value":"150g"},{"label":"Adipisicing","value":"1kg"},{"label":"Dolorem obcaecati","value":"3 Teaspoon"},{"label":"Porro","value":"2 pack"},{"label":"Vel fuga","value":"300g"}]}},{"id":"new-breakfast-menu-renaissance","content":"\\r\\nThe cauliflower is roasty and seasoned to the max, and the chickpeas get just a little bit chunky and creamy when you give them a few good smashed. Theyre just a bit TOO round sometimes, ya know?\\r\\n\\r\\nYou can make a butter sauce from scratch, or you can just do as Ive been doing and buy the KFI brand butter chicken sauce from Costco which comes in a big jar and works like a charm. Ive also heard via your DMs on Instagram that their Vindaloo sauce is even better. If you dont have a Costco, any brand of tikka masala or Indian-spiced simmer sauces that you love would work just as well (and you can give it some love with a bit of extra cream or butter).\\r\\n\\r\\n###### Season and Roast the Cauliflower.\\r\\nCoat the cauliflower in spices and some avocado oil. Roast in the oven or air fryer till its roasty and yummy.\\r\\n\\r\\n###### Activate Your Yummy Butter Sauce.\\r\\nHomemade, with a pureed base of onions, garlic, ginger, spices, and tomato sauce plus cream and butter, is delicious. Or just use a store-bought sauce! Costco sells KFI brand butter chicken sauce and Ive been enjoying it as an SOS option.\\r\\n\\r\\n###### Add Your Chickpeas and Mash.\\r\\nOkay, you dont have to mash them. But sometimes chickpeas are just a bit too round. If you can understand that weird sentiment, youll probably enjoy a bit of mashing for texture.\\r\\n\\r\\n###### Add Cauliflower Back In.\\r\\nHere she comes, looking nice and roasty!  \\r\\n\\r\\n###### Youre Done! Yum!\\r\\nI love, love, love this with some kind of a cilantro sauce which is why youll see a waterfall of it on my bowl here.","title":"Butter Cauliflower and Chickpeas with Mint Cilantro Sauce","date":"2022-01-02","image":"/img/blog/9.jpg","categories":["Gastronomy"],"tags":["Fast food","Recipes"],"author":"Nguta Ithya","short":"This Butter Cauliflower and Chickpeas is a weeknight staple! Roasty spiced cauliflower, a jar of butter sauce, a can of chickpeas, and a pile of steamy rice with a waterfall of mint sauce on top.","introLayout":1,"postLayout":1,"details":{"title":"Ingredients:","items":[{"label":"Numquam","value":"1 pack"},{"label":"Cupiditate","value":"150g"},{"label":"Adipisicing","value":"1kg"},{"label":"Dolorem obcaecati","value":"3 Teaspoon"},{"label":"Porro","value":"2 pack"},{"label":"Vel fuga","value":"300g"}]}}]');

